import React from 'react'
import login from '../services/login'
import Blog from './Blog'

const BlogList = ({ blogs, userLogged }) => {
  return (
    <div>
    <h2>blogs</h2>
        <p>{userLogged.name} logged in</p>
        {blogs.map(blog => {
            console.log(blog.id)
            return (
                <Blog key={blog.id} blog={blog} />
            )}
        )}
    </div>
  )
}

export default BlogList
